import React from 'react'
import PersonalCardUser from './PersonalCardUser'

function PersonalDashboardContainer({user}) {
    return (
        <div className='bg-gray-100 rounded-3xl '>
                <PersonalCardUser   img={user.img} 
                                    likes={user.likes} 
                                    dislikes={user.dislikes} 
                                    sessions={Math.ceil(Math.random()*10000/user.likes)/*user.category==='Normal'?user.timeOfSessions:user.visibility*/}
                                    isVerified={Math.random()*10>5?true:false}
                                    category={user.category}
                    />
        </div>
    )
}

export default PersonalDashboardContainer
